  `update_time` int(11) DEFAULT '0',
  `is_del` int(11) DEFAULT '0' COMMENT '0:否/1：是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='用户表';

