  `audit_status` tinyint(4) DEFAULT '1' COMMENT '是否开启审核  0不开启 1开启',
  `remind` text COMMENT '交易提醒',
  `logo` varchar(255) DEFAULT NULL COMMENT '公司logo',
  `phone` varchar(20) DEFAULT NULL COMMENT '商家电话',
  `top_money` decimal(10,2) DEFAULT NULL COMMENT '置顶所需费用',
  `top_cycle` int(11) DEFAULT '0' COMMENT '置顶周期',
  `recom` tinyint(4) DEFAULT '0' COMMENT '首页会员推荐是否开启 0不开启 1开启',
  `plate_type` tinyint(4) DEFAULT '1' COMMENT '小程序首页车辆显示样式  1显示详情图  2不显示详情图',
  `sale_logo` varchar(255) DEFAULT NULL,
  `flow_id` varchar(50) DEFAULT NULL COMMENT '流量主ID',
  `flow_set` tinyint(2) DEFAULT '1' COMMENT '详情页是否开启流量主 1关闭 2开启',
  `head_flow` tinyint(2) DEFAULT '1' COMMENT ' 首页是否开启流量主 1关闭 2开启',
  `sell_flow` tinyint(2) DEFAULT '1' COMMENT '卖车页是否开启流量主 1关闭 2开启',
  `store_flow` tinyint(2) DEFAULT '1' COMMENT '店铺页是否开启流量主 1关闭 2开启',
  `flow_set_id` varchar(50) DEFAULT NULL COMMENT '详情页流量主广告位ID',
  `head_flow_id` varchar(50) DEFAULT NULL COMMENT '首页流量主广告位ID',
  `map_key` varchar(50) DEFAULT NULL COMMENT '腾讯地图开放平台秘钥',
  `juhe_appkey` varchar(255) DEFAULT NULL COMMENT '聚合appkey',
  `weizhang_num` int(11) DEFAULT '5' COMMENT '默认可查询违章次数',
  `weizhang_money` decimal(10,2) DEFAULT NULL COMMENT '查询10次违章费用',
  `area_set` tinyint(1) DEFAULT '2' COMMENT '地区筛选：1开启 2关闭',
  `consult_set` tinyint(1) DEFAULT '2' COMMENT '免费咨询按钮设置 1开启 2关闭',
  `evaluate_set` tinyint(1) DEFAULT '2' COMMENT '爱车估价按钮设置 1开始 2关闭',
  `qipei_open` tinyint(1) DEFAULT '0' COMMENT '汽配功能开关 0关闭 1开启',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

